import './App.css';
import './components/Booklist.js';
import './components/StreakView.js';
import './components/ReadingUpdater.js';

function App() {
  return (
    <div>
    	<h1>Bookworm</h1>
    	<h2>Streak: [streaknumber] Total reading: [totalpages] pages</h2>
    	<button>Update read pages!</button>
    	<h3>Your books</h3>
    	<ul>
    		<li>[Bookname 1] [completionpercentage] %</li>
    		<li>[Bookname 2] [completionpercentage] %</li>
    	</ul>
    </div>
  );
}

export default App;
